//递归求最大公约数
#include <iostream>
using namespace std;
int gcd(int m, int n) {
	return n == 0 ? m : gcd(n, m % n);
}
int main() {
	int m, n; cin>>m>>n;
	cout<<gcd(m, n)<<endl;
	return 0;
}
